import React from 'react'

const DButton = (props) => {
  return (
    <button className="info-button" onClick={props.onClick}>
      Define
    </button>
  )
}

const IButton = (props) => {
  return (
    <button className="info-button" onClick={props.onClick}>
      Information
    </button>
  )
}

const CButton = (props) => {
  return (
    <button className="info-button" onClick={props.onClick}>
      Context
    </button>
  )
}

const EButton = (props) => {
  return (
    <button className="info-button"  onClick={props.onClick}>
      Example
    </button>
  )
}

const ViewAll = (props) => {
  return (
    <button className="view-all" onClick={props.onClick}>
      All
    </button>
  )
}

const InfoButtonWrapper = () => {
  return (
    <aside className="info-button-wrapper">
          <DButton />
          <IButton />
          <CButton />
          <EButton />
          <ViewAll />
    </aside>
  )
}
export { InfoButtonWrapper }
